import React from 'react';
import './Directory.css';
import MenuItem from '../menu-item/MenuItem';

function Directory() {

    return (
        <div className="directory">
            <MenuItem title="Buy" subTitle="All Products" />
            <MenuItem title="Sell" subTitle="Sell Now" />
            <MenuItem title="Tech" />
            <MenuItem title="Clothes" />
            <MenuItem title="Art" />

        </div> 
    );
};
